function sizeFilter($bytes, $decimals = 2) {
	$label = array('B', 'KB', 'MB', 'GB', 'TB', 'PB', 'EB');
	$factor = floor((strlen($bytes) - 1) / 3);
	$filteredSize = $bytes/pow(1024, $factor);
	$filteredSize = sprintf("%.{$decimals}f", $filteredSize);
	$sizeString = $filteredSize . $label[$factor];
	return $sizeString;
}

function filesGroupDir($dir, $array) {
	$dirArr = [];
	$fileArr = [];
	foreach ($array as $k => $v) {
		$path = getRealPath($dir.$v);
		if(file_exists($path) && is_dir($path)) {
			$dirArr = array_merge($dirArr, [$v]);
		} else {
			$fileArr = array_merge($fileArr, [$v]);
		}
	}
	return array_merge($dirArr, $fileArr);
}

function getRealPath($path) {
	$rpath = realpath($path);
	if (($rpath === false) && file_exists($path)) {
		$escapedPath = escapeshellarg($path);
		$execOutput = [];
		$execReturn = 1;
		@exec("realpath $escapedPath", $execOutput, $execReturn);
		if ($execReturn === 0) {
			$rpath = $execOutput[0];
		}
	}
	return $rpath;
}

function getFileSize($path) {
	$size = filesize($path);
	if (($size === false) && file_exists($path)) {
		$escapedPath = escapeshellarg($path);
		$execOutput = [];
		$execReturn = 1;
		@exec("stat -Lc%s $escapedPath", $execOutput, $execReturn);
		if ($execReturn === 0) {
			$size = $execOutput[0];
		}
	}
	return $size;
}

function getFileMTime($path) {
	$mtime = filemtime($path);
	if (($mtime === false) && file_exists($path)) {
		$escapedPath = escapeshellarg($path);
		$execOutput = [];
		$execReturn = 1;
		@exec("stat -Lc%Y $escapedPath", $execOutput, $execReturn);
		if ($execReturn === 0) {
			$mtime = $execOutput[0];
		}
	}
	return $mtime;
}

function scanDirGrouped($dir = ".") {
	if (!is_dir($dir)) {
		return false;
	}

	$dirArr = [];
	$fileArr = [];

	if ($handle = opendir($dir)) {
		while (($entry = readdir($handle)) !== false) {
			$filepath = $dir . '/' . $entry;
			//echo "$entry\n";
			if (is_dir($filepath)) {
				$dirArr = array_merge($dirArr, [$entry]);
			} else {
				$fileArr = array_merge($fileArr, [$entry]);
			}
		}
		closedir($handle);
	}
	return array_merge($dirArr, $fileArr);
}

function main() {
	global $indexStyle;
	$dir = $_SERVER['PATH_ROOT'] . $_SERVER['PATH_INFO'];

	set_time_limit(0);
	@ini_set('zlib.output_compression',0);
	@ini_set('implicit_flush',1);
	@ob_implicit_flush(1);
	@ob_end_flush();

	header('Content-Type: text/html; charset=utf-8');
	header('Expires: 0');
	header('Cache-Control: must-revalidate, post-check=0, pre-check=0');
	header('Pragma: public');
	header('Content-Encoding: none;');
	header('X-Accel-Buffering: no');

	$html = "";

	$html .= "<!DOCTYPE html>\n";
	$html .= "<html>\n";
	$html .= "<head>\n";
	$html .= "<meta charset=\"UTF-8\">\n";
	$html .= "<meta name=\"viewport\" content=\"width=device-width, initial-scale=1, maximum-scale=1\">\n";
	$html .= "<style>" . $indexStyle . "</style>\n";
	$html .= "</head>\n";
	$html .= "<body>\n";
	$html .= "<h2>Index of " . $_SERVER['PATH_INFO'] . "</h2>\n";
	$html .= "<table>\n";

	$html .= "<tr>\n";
	$html .= "<th class=\"th-name\">Name</th>\n";
	$html .= "<th class=\"th-size\">Size</th>\n";
	$html .= "<th class=\"th-time\">Time</th>\n";
	$html .= "</tr>\n";

	$html .= "<tr>\n";
	$html .= "<td><a href=\"..\">..</a></td>\n";
	$html .= "<td></td>\n";
	$html .= "<td></td>\n";
	$html .= "</tr>\n";

	echo $html;

	$files = array_diff(scandir($dir), array('.', '..'));
	if (count($files) < 1000) {
		$files = filesGroupDir($dir, $files);
	}

	foreach ($files as $k => $v) {
		$html = "";
		$name = $v;
		$path = getRealPath($dir.$v);
		$datemodified = (file_exists($path) ? date('Y\-m\-d H:i', getFileMTime($path)) : '-');
		$size = (file_exists($path) ? sizeFilter(getFileSize($path)) : '-');
		$hrefSuffix = '';
		if(file_exists($path) && (filetype($path) == 'dir')) {
			$hrefSuffix = '/';
			$size = "-";
		}
		$html .= "<tr>\n";
		$html .= "<td class=\"td-name\"><a href=\"" . $v.$hrefSuffix . "\">" . $name.$hrefSuffix . "</a></td>\n";
		$html .= "<td class=\"td-size\">" . $size . "</td>\n";
		$html .= "<td class=\"td-time\">" . $datemodified . "</td>\n";
		$html .= "</tr>\n";
		echo $html;
	}

	$html = "";
	$html .= "</table>\n";
	$html .= "</body>\n";
	$html .= "</html>\n";

	echo $html;
}

main();

